import axios from "axios";

export const apiClient = axios.create({
  baseURL: "http://localhost:8080/api",
  withCredentials: false,
});

axios({
  method: "get",
  url: `https://api.someurl.com/subject/v2/resource/somevalue`,
  withCredentials: false,
  params: {
    access_token: SECRET_TOKEN,
  },
});
